import React from 'react'

const headerStyle = {
    height: '7vh',
    border: "1px solid red",
    display: 'flex',
    justifyContent: 'space-around'
}

const logoStyle = {
    width: "30%",
    border: "1px solid green",
}

const itemStyle = {
  width: "70%",
  border: "1px solid blue",
  display: "flex",
  justifyContent: "space-around",
};

const itemIndividualStyle = {
    border: "1px solid purple",
    marginTop: "5px"
    
}


export default function Header() {
  return (
    <div style={headerStyle}>
      <div style={logoStyle}>logo</div>
      <div style={itemStyle}>
        <div style={itemIndividualStyle}>Add User</div>
        <div style={itemIndividualStyle}>Edit</div>
        <div style={itemIndividualStyle}>Contact</div>
        <div style={itemIndividualStyle}>About</div>
      </div>
    </div>
  );
}
